    </BrowserRouter>
  );*/

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Signup />} />
        <Route path="/home" element={<Login />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;



